import React from 'react';
import ReactDOM from 'react-dom';
import './04study.css'


// 函数式组件
function Childcom() {
  let title = <h2>这是副标题</h2>
  return (
    <div>
      <h1>hellow world!</h1>
      {title}
    </div>
  )
}

ReactDOM.render(
  <Childcom />,
  document.querySelector('#root')
)
